import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const MyLayout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
);

export default MyLayout;
